import React from 'react'

export default function Footer() {
    return (
        <footer class="main-footer">
    <strong>king mongkut's institute of technology ladkrabang, <a href="https://www.ic.kmitl.ac.th/moodle/">Software Engineering</a>.</strong>
    <div class="float-right d-none d-sm-inline-block">
      <b>Team Software Project</b> (SE#9)
    </div>
  </footer>
    )
}
